import React from 'react';
import Card from '../../components/Card/Card';
import Button from 'components/CustomButtons/Button';
import GridItem from 'components/Grid/GridItem';
import CardFooter from 'components/Card/CardFooter';
import CardHeader from 'components/Card/CardHeader';
import { makeStyles } from '@material-ui/core/styles';
import CustomInput from 'components/CustomInput/CustomInput';
import CardBody from 'components/Card/CardBody';
import GridContainer from 'components/Grid/GridContainer';
import TextField from '@material-ui/core/TextField';

import Grid from '@material-ui/core/Grid';

const styles = {
  cardCategoryWhite: {
    color: 'rgba(255,255,255,.62)',
    margin: '0',
    fontSize: '14px',
    marginTop: '0',
    marginBottom: '0',
  },
  cardTitleWhite: {
    color: '#FFFFFF',
    marginTop: '0px',
    minHeight: 'auto',
    fontWeight: '300',
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: '3px',
    textDecoration: 'none',
  },
};

const useStyles = makeStyles(styles);

const Register = () => {
  const classes = useStyles();

  return (
    <>
      <GridItem xs={12} sm={12} md={8}>
        <Card>
          <CardHeader color='primary'>
            <h4 className={classes.cardTitleWhite}>Register Form</h4>
          </CardHeader>

          <CardBody>
            <form>
              <GridContainer>
                <GridItem xs={12} sm={12} md={6}>
                  <TextField
                    margin='normal'
                    required
                    fullWidth
                    name='username'
                    label='Username'
                    type='text'
                    id='username'
                    formControlProps={{
                      fullWidth: true,
                    }}
                  />
                </GridItem>
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText='Email address'
                    id='email-address'
                    formControlProps={{
                      fullWidth: true,
                    }}
                  />
                </GridItem>
              </GridContainer>
              <GridContainer>
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText='First Name'
                    id='first-name'
                    formControlProps={{
                      fullWidth: true,
                    }}
                  />
                </GridItem>
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText='Last Name'
                    id='last-name'
                    formControlProps={{
                      fullWidth: true,
                    }}
                  />
                </GridItem>
              </GridContainer>
              <GridContainer>
                <GridItem xs={12} sm={12} md={12}>
                  <TextField
                    margin='normal'
                    required
                    fullWidth
                    name='password'
                    label='Password'
                    type='password'
                    id='password'
                    formControlProps={{
                      fullWidth: true,
                    }}
                  />
                </GridItem>
              </GridContainer>
              <GridContainer>
                <GridItem xs={12} sm={12} md={12}>
                  <TextField
                    margin='normal'
                    required
                    fullWidth
                    name='passwordRepet'
                    label='Password Repet'
                    type='password'
                    id='passwordRepet'
                    formControlProps={{
                      fullWidth: true,
                    }}
                  />
                </GridItem>
              </GridContainer>
              <GridContainer>
                <Grid item xs={12} sm={6}>
                  <CardFooter>
                    <Button color='primary' type='submit'>
                      Register
                    </Button>
                  </CardFooter>
                </Grid>
              </GridContainer>
            </form>
          </CardBody>
        </Card>
      </GridItem>
    </>
  );
};

export default Register;
